import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router,Route,Routes } from 'react-router-dom';
import Signup from './Pages/Signup';
function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path='/Pages' element={<Signup/>}></Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
